
/*
http://www.jq22.com/jquery-info17240
一 带有确认按钮的提示框
 * 1.只有提示信息，没有标题和回调函数  $.myAlert('这里是提示框内的内容');
 * 2.带有标题和提示信息  $.myAlert({title:'Title',message:'message'});
 * 3.带有标题、提示信息和回调函数  
    $.myAlert({
        title:'Title',
        message:'message',
        callback:function(){}
    });
二  有确认和取消按钮的确认框
 * 1.只有提示信息和回调函数
    $.myConfirm({
        message:'确认框提示内容',
        callback:function(){}
    })
 * 2.带有标题，提示信息和回调函数
    $.myConfirm({
        title:'确认框提示标题',
        message:'确认框提示内容',
        callback:function(){}
    })
三 会自动消失，没有回调的提示条  
* $.myToast('提示内容');
四 加载中提示框
* $.myLoadding("这里是自定义内容")

五 关闭提示框
* $.removeModa();
 */
(function(){$.extend({removeModa:function(){$('.myModa').fadeOut(300);setTimeout(function(){$('.myModa').remove()},300)},myAlert:function(options){var option={title:"提示",message:"提示信息",callback:function(){}};if(typeof(options)=="string"){option.message=options}else{option=$.extend(option,options)}var top=$(window).height()*0.3;$('body').append('<div class="myModa"><div class="myAlertBox"  style="margin-top:'+top+'px"><h6>'+option.title+'</h6><p>'+option.message+'</p><div class="btn sure">确定</div></div></div>');;$('.btn.sure').click(function(){$.removeModa();option.callback()})},myConfirm:function(options){var option={title:"提示",message:"提示信息",callback:function(){}};if(typeof(options)=="string"){option.message=options}else{option=$.extend(option,options)}var top=$(window).height()*0.3;$('body').append('<div class="myModa"><div class="myAlertBox" style="margin-top:'+top+'px"><h6>'+option.title+'</h6><p>'+option.message+'</p><div class="col2"><div class="col" style="margin-right: 20px;"><div class="btn exit">取消</div></div><div class="col"><div class="btn sure">确定</div></div></div></div></div>');$('.btn.exit').click(function(){$.removeModa();});$('.btn.sure').click(function(){$.removeModa();option.callback()})},myToast:function(message){var top=$(window).height()*0.3;$('body').append('<div class="myToast">'+message+'</div>');var top=($(window).height()-$('.myToast').height())/2;var left=($('body').width()-$('.myToast').width())/2;$('.myToast').css({'top':top+'px','left':left+'px'});setTimeout(function(){$('.myToast').fadeOut(300);setTimeout(function(){$('.myToast').remove()},300)},1500)},myLoadding:function(message){var m=message||'';var top=$(window).height()*0.3;$('body').append('<div class="myModa"><div class="myLoadding"><img src="data:image/gif;base64,"/><p>'+m+'</p></div></div>');}})})(jQuery);